import React from 'react';
import { View } from 'react-native';
import { Table, Row, Rows } from 'react-native-table-component';

const data = [
  ['Count', 'Variety', 'Ripeness', 'Date', 'Time'],
  ['4', 'Sugar Baby', 'Unripe', 'Mar 9, 2024', '03:40'],
  ['3', 'Sugar Baby', 'Unripe', 'Mar 9, 2024', '03:31'],
  ['2', 'Crimson', 'Ripe', 'Mar 9, 2024', '03:26'],
  ['1', 'Crimson', 'Overripe', 'Mar 9, 2024', '03:20'],
];

const TableExample = () => {
  return (
    <View>
      <Table borderStyle={{ borderWidth: 1, borderColor: '#C1C0B9' }}>
        <Row
          data={data[0]}
          style={{ height: 40, backgroundColor: '#F8F8F9' }}
          textStyle={{ margin: 6 }}
        />
        <Rows data={data.slice(1)} textStyle={{ margin: 6 }} />
      </Table>
    </View>
  );
};

export default TableExample;
